// import logo from '../src/front-view-virtual-studio-background-260nw-1883360125.webp';
import './App.css';
import React from 'react'
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from './Components/NavBar'
import Schedule from './Components/Schedule';

function App() {
  return (
    <>
    <h1 className="heading">Interview Portal</h1>
    <Navbar/>
    <Router>
        {/* <Schedule/> */}
          <Routes>
            <Route path="/Schedule">
            <Schedule />
          </Route>
        </Routes>
    </Router>
    <div className='container' >Register YourSelf</div>
      <form method='POST'>
          <input type="text" name="name" placeholder="Enter Name" required/>
          <input type="email" name="email" placeholder="Enter Email" required/>
          <input type="text" name="role"  defaultValue={'User'}/>
        <input type="submit" value="Submit" />
      </form>
    </>
  )
}

export default App;
